import React, { Component } from "react";
import api from "../services/api";

import "./Feed.css";

import more from "../assets/mais.png";
import like from "../assets/like.png";
import comment from "../assets/comment.png";
import send from "../assets/send.png";

class Feed extends Component {
  state = {
    feed
  }
  async componentDidMount() {
    const response = await api.get("posts");


  }

  render() {
    return (
      <section id="post-list">
        <article>
          <header>
            <div className="user-info">
              <span>Arthur Amaral</span>
              <span className="place">Amsterdan</span>
            </div>
            <img src={more} alt="Mais" />
          </header>

          <img
            src="http://localhost:3333/files/IMG_20190412_182942951.jpg"
            alt=""
          />

          <footer>
            <div className="actions">
              <img src={like} alt="curtir" />
              <img src={comment} alt="comentar" />
              <img src={send} alt="compartilhar" />
            </div>

            <strong>900 curtidas</strong>

            <p>
              Um post doido
              <span>#Hashtag</span>
            </p>
          </footer>
        </article>
      </section>
    );
  }
}

export default Feed;
